SELECT seq,
       node,
       edge,
       pt.cost AS cost,
       agg_cost,
       the_geom
FROM pgr_dijkstra('SELECT gid as id, source, target, st_length(the_geom, true) as cost FROM ways', 1, 5000) AS pt
JOIN ways rd ON pt.edge = rd.gid;


SELECT SOURCE
FROM ways
ORDER BY ST_Distance(ST_StartPoint(the_geom), ST_SetSRID(ST_MakePoint(20.983455, 52.231909), 4326), TRUE) ASC LIMIT 1;


  (SELECT SOURCE
   FROM ways
   ORDER BY ST_Distance(ST_StartPoint(the_geom), ST_SetSRID(ST_MakePoint(20.973400, 52.169647), 4326), TRUE) ASC LIMIT 1);


SELECT seq,
       st_astext(the_geom)
FROM pgr_dijkstra('SELECT gid as id, source, target, st_length(the_geom, true)/cl.priority as cost FROM ways JOIN osm_way_classes cl ON ways.class_id = cl.class_id',
                    (SELECT SOURCE
                     FROM ways
                     ORDER BY ST_Distance(ST_StartPoint(the_geom), ST_SetSRID(ST_MakePoint(21.0256570731, 52.2101133595), 4326), TRUE) ASC LIMIT 1),
                    (SELECT SOURCE
                     FROM ways
                     ORDER BY ST_Distance(ST_StartPoint(the_geom), ST_SetSRID(ST_MakePoint(21.0309609953, 52.1599976833), 4326), TRUE) ASC LIMIT 1)) AS pt
JOIN ways rd ON pt.edge = rd.gid;


SELECT gid AS id,
       SOURCE,
       target,
       st_length(the_geom, TRUE)/cl.priority AS cost,
       cl.priority,
       cl.name,
       cl.type_id
FROM ways
JOIN osm_way_classes cl ON ways.class_id = cl.class_id
WHERE (cl.class_id >= 200
       AND cl.class_id < 300)
  OR (cl.class_id >= 117
      AND cl.class_id <= 119)
ORDER BY id ASC LIMIT 100;


SELECT cl.priority,
       cl.name
FROM osm_way_classes cl
WHERE (cl.class_id >= 200
       AND cl.class_id < 300)
  OR (cl.class_id >= 117
      AND cl.class_id <= 119);


SELECT seq,
       '(' || start_vid || ',' || end_vid || ')' AS path_name,
                                  path_seq AS _path_seq,
                                  start_vid AS _start_vid,
                                  end_vid AS _end_vid,
                                  node AS _node,
                                  edge AS _edge,
                                  cost AS _cost,
                                  lead(agg_cost) over() AS _agg_cost
FROM pgr_dijkstra('
                  SELECT ways.gid AS id, SOURCE AS SOURCE, target AS target, ST_LENGTH(the_geom, TRUE) AS cost
                  FROM ways
                  WHERE ways.the_geom && ST_MakeEnvelope(20.8031668825, 52.075110837, 21.1787604925, 52.3179645367, 4326) ', array[2314]::BIGINT[], array[4324]::BIGINT[], FALSE);


SELECT *
FROM shortest_path_astar('
                         SELECT gid AS id, SOURCE::int4, target::int4, LENGTH::double PRECISION AS cost, x1, y1, x2, y2
                         FROM dourol',3, 7, FALSE, FALSE);


SELECT *
FROM pgr_astar('SELECT gid as id, source, target, cost, reverse_cost, x1, y1, x2, y2 FROM ways',
                 (SELECT SOURCE
                  FROM ways
                  ORDER BY ST_Distance(ST_StartPoint(the_geom), ST_SetSRID(ST_MakePoint(21.0256570731, 52.2101133595), 4326), TRUE) ASC LIMIT 1),
                 (SELECT SOURCE
                  FROM ways
                  ORDER BY ST_Distance(ST_StartPoint(the_geom), ST_SetSRID(ST_MakePoint(21.0309609953, 52.1599976833), 4326), TRUE) ASC LIMIT 1)) AS pt
JOIN ways rd ON pt.edge = rd.gid;

