SELECT *
FROM pgr_astar('SELECT ways.gid as id, ways.source, ways.target, ways.cost as cost, ways.x1, ways.y1, ways.x2, ways.y2 FROM ways JOIN osm_way_classes cl ON ways.class_id = cl.class_id',
                 57170,
                 111675) AS pt
JOIN ways rd ON pt.edge = rd.gid;

SELECT *
FROM pgr_astar(' SELECT ways.gid AS id,
    ways.source,
    ways.target,
    ways.cost / cl.priority as cost,
    ways.reverse_cost/ cl.priority as reverse_cost,
    ways.x1,
    ways.y1,
    ways.x2,
    ways.y2
   FROM ways JOIN osm_way_classes cl ON ways.class_id = cl.class_id
  ORDER BY ways.gid',
                 57170,
                 111675) AS pt
JOIN ways rd ON pt.edge = rd.gid;


SELECT ST_GeometryType(the_geom)
FROM ways LIMIT 1;

SELECT ST_GeometryType(the_geom)
FROM pgr_astar('SELECT gid as id, source, target, cost, reverse_cost, x1, y1, x2, y2 FROM ways',
                 (SELECT SOURCE
                  FROM ways
                  ORDER BY ST_Distance(ST_StartPoint(the_geom), ST_SetSRID(ST_MakePoint(21.0256570731, 52.2101133595), 4326), TRUE) ASC LIMIT 1),
                 (SELECT SOURCE
                  FROM ways
                  ORDER BY ST_Distance(ST_StartPoint(the_geom), ST_SetSRID(ST_MakePoint(21.0309609953, 52.1599976833), 4326), TRUE) ASC LIMIT 1), FALSE) AS pt
JOIN ways rd ON pt.edge = rd.gid LIMIT 1;


SELECT *
FROM stations
WHERE ST_within(the_geom, ST_Buffer(ST_MakeLine(
                                                  (SELECT the_geom
                                                   FROM stations
                                                   WHERE uid=2585306),
                                                  (SELECT the_geom
                                                   FROM stations
                                                   WHERE uid=2585790))::geography,
                                      (SELECT st_length/3
                                       FROM ST_Length(ST_MakeLine(
                                                                    (SELECT the_geom
                                                                     FROM stations
                                                                     WHERE uid=2585306),
                                                                    (SELECT the_geom
                                                                     FROM stations
                                                                     WHERE uid=2585790))::geography)))::geometry)=TRUE;

